import React from 'react';
import ExperienceCard from "./ExperienceCard";
import {
    Container,
    Row,
    Jumbotron
} from "react-bootstrap";

const Experience = ({experiences}) => {
    return (
        <section className="section">
            <Container>
                <Jumbotron fluid className="bg-white">
                    <h2 className="display-4 mb-5 text-center">
                        {experiences.heading}
                    </h2>
                    <h2 className="display-4 mb-5 text-center">
                    <div class="container">
                    <div class="row">
  	                  <h2 className="display-4 mb-5 text-center">{experiences.subheading1}</h2>
                      <h2 className="py-3 px-md-5 text-center">{experiences.subheading2}</h2>
                    </div>
                    </div>
                    </h2>

                    <Row>
                        {
                            experiences.data.map(data => {
                                return <ExperienceCard key={data.company} data={data} />
                            })
                        }
                  </Row>
                </Jumbotron>
            </Container>
        </section>
    );
}

export default Experience;
